import { createId } from '@paralleldrive/cuid2';

interface IBasket {
  id: string;
  items: IBasketItems[];
}

interface IBasketItems {
  id: number;
  position: string;
  salary: number;
  companyName: string;
  location: string;
}

export class Basket implements IBasket {
  id = createId();
  items: IBasketItems[] = [];
}
